import Landing from "../src/pages/Landing";
import styled from 'styled-components'
import { BrowserRouter, Routers, Router, Link } from 'react-router-dom'

const Button = styled.button`
background: red;
color:white;
font-size: 1rem;
`;
function App() {
  return (
    <BrowserRouter>
      <Routers >
        <Landing />
      </Routers>
    </BrowserRouter>
  )
}

export default App;
